export const getAllPropertyKeys = (obj) => [
    ...Object.getOwnPropertyNames(obj),
    ...Object.getOwnPropertySymbols(obj),
    ...Object.keys(Object.getPrototypeOf(obj) || {}),
].filter((k, i, arr) => arr.indexOf(k) === i);
